import { ACTIONS } from "../App"

export default function GreatOperationButton({ dispatch, operation }) {
  return (
    <button
      onClick={() =>
        dispatch({ type: ACTIONS.CHOOSE_OPERATION, payload: { operation } }
          )
      }
    >
      {operation}
    </button>
  )
}
